-- Volcando estructura para procedimiento venus.sp_atenciones_operador
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_atenciones_operador`(mes int)
select 
CONCAT(p.apellido_paterno_persona,', ',p.nombres_persona) as operador,
COUNT(a.id_atencion) as cantidad
 from tottus_atenciones a 
inner join tb_personas p on a.id_responsable_final = p.id_persona
WHERE a.semana = mes and a.estado = 1 and a.estado_atencion = 1 GROUP BY operador//
DELIMITER ;


-- Volcando estructura para procedimiento venus.sp_reporte_dia
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporte_dia`(dia VARCHAR(10))
select COUNT(r.descripcion)cantidad,r.descripcion from tottus_atenciones a 
inner join tottus_requerimiento_atenciones r on a.id_requerimiento = r.id_requerimiento where a.fecha_atencion = dia  and a.estado = 1 and a.estado_atencion = 1 GROUP BY r.descripcion//
DELIMITER ;


