DELIMITER ;


-- Volcando estructura para procedimiento venus.sp_reporte_mes
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporte_mes`(mes int)
select COUNT(r.descripcion)cantidad,r.descripcion,date_format(MAX(a.fecha_atencion),'%d / %m / %Y') as fecha_atencion from tottus_atenciones a 
inner join tottus_requerimiento_atenciones r on a.id_requerimiento = r.id_requerimiento where MONTH(a.fecha_atencion) = mes  and a.estado = 1 and a.estado_atencion = 1 GROUP BY r.descripcion
ORDER BY fecha_atencion  desc//
DELIMITER ;


-- Volcando estructura para procedimiento venus.sp_reporte_mes_operador
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporte_mes_operador`(mes int)
select 
CONCAT(p.nombres_persona,' ',
p.apellido_paterno_persona,' ',
p.apellido_materno_persona)as persona,
r.descripcion,
CONCAT(p.nombres_persona,' ',
p.apellido_paterno_persona,' ',
p.apellido_materno_persona,' / ',r.descripcion) as lista,
COUNT(CONCAT(p.nombres_persona,' ',
p.apellido_paterno_persona,' ',
p.apellido_materno_persona,'/',r.descripcion)) as cantidad
from tottus_atenciones a 
inner join tottus_requerimiento_atenciones r on a.id_requerimiento = r.id_requerimiento 
inner join tb_personas p on a.id_responsable_final = p.id_persona
where MONTH(a.fecha_atencion) = mes  and a.estado = 1 and a.estado_atencion = 1 GROUP BY lista//
DELIMITER ;


-- Volcando estructura para procedimiento venus.sp_reporte_semana
DELIMITER //
